import { useEffect, useState } from "react";
import Head from "next/head";

import styled from "styled-components";
import { Chapeau, Labor } from "../styled/typos";
import { Wrapper } from "../styled/space";

import { useMocks } from "../context/mock-context";

const client = require("contentful").createClient({
  space: "86i03dw6wwwc",
  accessToken: "fs65wT3qwmrz2Rcyh0fFkJE2uukw1N5mxY9_IzljpH0"
});

function Proposition() {
  const { proposition } = useMocks();

  return (
    <>
      <Head>
        <title>Societer | la Proposition</title>
      </Head>

      <Wrapper>
        <FirstPart>
          <Chapeau>{proposition.chapeau}</Chapeau>
          <Labor>{proposition.firstPartLabor}</Labor>
        </FirstPart>
      </Wrapper>
    </>
  );
}

export default Proposition;

const FirstPart = styled.div`
  padding-top: 200px;
  display: flex;
  flex-direction: row;

  h3 {
    max-width: 50%;
    padding-right: 90px;
  }

  p {
    color: ${props => props.theme.colors.white};
  }
`;

const Titles = styled.div`
  width: 100%;
  z-index: 10;
  position: absolute;
  top: 50%;
  h1 {
    width: 50%;
  }
  h3 {
    color: ${props => props.theme.colors.white};
  }
`;
